SELECT DISTINCT
	Lvl.BF_SSN--,
	--Lvl.LN_SEQ
FROM
	@SSNS S
	INNER JOIN UDW..LNXX_LON_RPS Lvl
		ON Lvl.BF_SSN = S.SSN
		AND Lvl.LC_STA_LONXX = 'A'
		AND Lvl.LC_TYP_SCH_DIS = 'L'
	INNER JOIN UDW..LNXX_LON_RPS IB
		ON IB.BF_SSN = Lvl.BF_SSN
		AND IB.LN_SEQ = Lvl.LN_SEQ
		AND IB.LC_STA_LONXX = 'I'
		AND IB.LC_TYP_SCH_DIS = 'IB'
		AND CAST(IB.LF_LST_DTS_LNXX AS DATE) = 'XXXX-XX-XX'
	INNER JOIN UDW..RSXX_BR_RPD RSXX
		ON RSXX.BF_SSN = S.SSN
		AND CAST(RSXX.LD_STA_RPSTXX AS DATE) = 'XXXX-XX-XX'